        drinks.add(new drink(("12914").toString() , ("Egg-Nog - Classic Cooked").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("Punch \\/ Party Drink").toString() , ("").toString() , ("Optional alcohol").toString() , ("Pitcher").toString() , ("In large saucepan, beat together eggs, sugar and salt, if desired. Stir in 2 cups of the milk. Cook over low heat, stirring constantly, until mixture is thick enough to coat a metal spoon and reaches 160 degrees F. Remove from heat. Stir in remaining 2 cups milk and vanilla. Cover and regfigerate until thoroughly chilled, several hours or overnight. Just before serving, pour into bowl or pitcher. Garnish or add stir-ins, if desired. Choose 1 or several of: Chocolate curls, cinnamon sticks, extracts of flavorings, flavored brandy or liqueur, fruit juice or nectar, ground nutmeg, maraschino cherries, orange slices, peppermint sticks or candy canes, plain brandy, run or whiskey, sherbet or ice-cream, whipping cream, whipped. Serve immediately.").toString() , ("").toString() , ("In einem gro\\u00dfen Topf Eier, Zucker und Salz verquirlen. 2 Tassen der Milch unterr\\u00fchren. Bei schwacher Hitze unter st\\u00e4ndigem R\\u00fchren kochen, bis die Mischung dick genug ist, um einen Metalll\\u00f6ffel zu \\u00fcberziehen und 70 Grad Celsius erreicht. Vom Herd nehmen. Die restlichen 2 Tassen Milch und Vanille unterr\\u00fchren. Zugedeckt und gek\\u00fchlt bis zur vollst\\u00e4ndigen Abk\\u00fchlung, mehrere Stunden oder \\u00fcber Nacht. Kurz vor dem Servieren in eine Sch\\u00fcssel oder einen Krug geben. Garnieren oder erg\\u00e4nzen Sie Mischung, wenn gew\\u00fcnscht. W\\u00e4hlen Sie 1 oder mehrere: Mit Schoko-Curls, Zimtstangen, Aromaextrakte, aromatisierter Brandy oder Lik\\u00f6r, Fruchtsaft oder Nektar, gemahlene Muskatnuss, Maraschinokirschen, Orangenscheiben, Pfefferminzstangen oder Zuckerstangen, schlichter Brandy, Rum oder Whiskey, Sorbet oder Eis, Schlagsahne, aufschlagen. Sofort servieren.").toString() , ("").toString() , ("").toString() , ("").toString() , ("https:\\/\\/www.thecocktaildb.com\\/images\\/media\\/drink\\/quxsvt1468875505.jpg").toString() , ("Egg").toString() , ("Sugar").toString() , ("Salt").toString() , ("Milk").toString() , ("Vanilla extract").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("6 ").toString() , ("1\\/4 cup ").toString() , ("1\\/4 tsp ").toString() , ("1 qt ").toString() , ("1 tsp ").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("No").toString() , ("2016-07-18 21:58:25").toString() ));

        drinks.add(new drink(("17246").toString() , ("Empell\\u00f3n Cocina\'s Fat-Washed Mezcal").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("Cocktail").toString() , ("").toString() , ("Alcoholic").toString() , ("Beer Glass").toString() , ("To ensure that your pork fat is just as delicious as theirs, here\\u2019s their adobo marinade and what to do with it (you\\u2019ll also need a rack of ribs):\\r\\n\\r\\n4 ancho chiles, 8 guajillo chiles and 4 chipotle chiles, plus 4 cloves roasted garlic, half a cup of cider vinegar, a quarter teaspoon of Mexican oregano, 1 teaspoon of ground black pepper, a whole clove, a quarter teaspoon of ground cinnamon and a half teaspoon of ground cumin.\\r\\n\\r\\nToast the dried chiles and soak in water for at least an hour until they are rehydrated. Drain and discard the soaking liquid. Combine the soaked chiles with the remaining ingredients and pur\\u00e9e until smooth.\\r\\n\\r\\nCold smoke a rack of baby back pork ribs by taking a large hotel pan with woodchips on one side and charcoal on the other. Place another, smaller, pan with pork ribs, above the charcoal\\/woodchip pan. Ignite the charcoal, being careful to not ignite the woodchips. Cover both pans with foil and allow to smoke for 10-15 minutes, until desired level of smoke is achieved, then coat with adobo marinade and wrap in tin foil prior to placing ribs in a 300 degree oven for 7 hours. When the ribs have cooled, strain off the fat and use for the infusion.\\r\\n\\r\\nIf you\\u2019re having a hard time coming up to the same kind of volume of fat, make up the balance with pork lard from a butcher. To get the same depth of flavor without the ribs, heat up the fat in a pot with a few spoons of the marinade.\\r\\n\\r\\nOnce you\\u2019ve got your tub of seasoned pork fat in cooled liquid form, pour equal amounts of Ilegal Joven mezcal and fat into a sealable container. Seal the container and give it a really good shake, then put it in the freezer overnight. When the whole thing is separated and congealed, pour it through a fine mesh chinoise. If you don\\u2019t have a chinoise, try a fine mesh strainer, or if you don\\u2019t have one of those, try spooning off most of the fat. There will be some beads of orange fat left in the strained mezcal: run that through a few layers of cheesecloth (or coffee filters in a pinch) to get rid of the last of it.\\r\\n\\r\\nThe mezcal is now ready for drinking, straight-up or in a cocktail. \\r\\n\\r\\nHabanero tincture\\r\\n\\r\\nSlice habaneros and add 2 ounces Ilegal Joven mezcal.\\r\\nAllow to sit overnight or until desired level of heat is achieved.\\r\\nCocktail\\r\\n\\r\\nCombine mezcal and chocolate liqueur in a mixing glass with ice and stir for 45 seconds.\\r\\nStrain into chilled coupe.\\r\\nCarefully \\'sink\\' the coffee liqueur down the inside of the coupe over a spoon.\\r\\nGarnish with 5 drops habanero tincture.").toString() , ("").toString() , ("Damit Ihr Schweinefett genauso lecker ist wie ihres, gibt es hier die Adobo-Marinade und was man damit machen kann (Sie ben\\u00f6tigen auch ein Rippchen)").toString() , ("").toString() , ("").toString() , ("").toString() , ("https:\\/\\/www.thecocktaildb.com\\/images\\/media\\/drink\\/osgvxt1513595509.jpg").toString() , ("Mezcal").toString() , ("Chocolate liqueur").toString() , ("Coffee liqueur").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("2 oz").toString() , ("3\\/4 oz").toString() , ("1\\/2 oz").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("").toString() , ("No").toString() , ("2017-12-18 11:11:49").toString() ));

